package lc.june2020;

import java.util.*;

public class q19 {
    static public String naiveSearch(String str, int len) {
        int N = str.length() - len + 1;
        Set<String> set = new HashSet<>();
        for (int i = 0; i < N; i++) {
            String tmp = str.substring(i, i + len);
            if (set.contains(tmp)){
                return tmp;
            } else {
                set.add(tmp);
            }
        }
        return null;
    }
    static public boolean isOneChar(String str){
        char ch = str.charAt(0);
        for(int i = 1; i < str.length();i++){
           if (ch != str.charAt(i)){
               return false;
           }
        }
        return true;
    }
    static public String longestDupSubstring(String S) {
        int len = 1;
        String ret = "";
        String tmp = naiveSearch(S, len);
        if (tmp == null){
            return ret;
        }
        if (isOneChar(S)){
            return S.substring(0,S.length()-1);
        }
        len = 2;
        while (len <= S.length()) {
            tmp = naiveSearch(S, len);
            if ( tmp != null) {
                ret = tmp;
                len = len * 2;
            } else {
                int h = len-1;
                int l = len/2;
                while( l <= h ){
                   int m = l + (h-l)/2;
                    tmp = naiveSearch(S,  m);
                    if ( tmp!=null){
                         ret = tmp;
                         l   = m +1;
                    } else {
                         h   = m -1;
                    }
                }
                return ret;
            }
        }
        return ret;
    }
    public static void main(String[] args) {
        String str = "";
        str = "aaaaa";
    //    str ="abcd";
        System.out.println(str.length());
        System.out.println(longestDupSubstring(str));
        //"akyj"
    }

}
